description:
Ever wondered what a cross between Tetris and Lemmings would look like?
Well, wonder no more, 'cause...MouseCraft is here! 

MouseCraft is an A to B puzzle game where players help mice in their relentless quest for cheese by stacking world's most famous blocks: Tetrominos.

Starring: Crazy Cat Scientist, Three Blind Mice and tons of irresistibly delicious Cheese.
